Source Block:
   //#################################################################
   //Read response channel
   //#################################################################
   assign    m_axi_rready         = ~txrr_wait;

   always @( posedge m_axi_aclk )
       if ( ~m_axi_aresetn )
           m_axi_rdata_reg <= 'b0;
       else
           m_axi_rdata_reg <= m_axi_rdata;

   always @( posedge m_axi_aclk )
     if( ~m_axi_aresetn ) 
       begin      
	  txrr_data[31:0]     <= 32'b0;

Delete:
always @( posedge m_axi_aclk )
    if ( ~m_axi_aresetn )
        m_axi_rdata_reg <= 'b0;
    else
        m_axi_rdata_reg <= m_axi_rdata;
